  false,\n\t\"url\": null,\n\t\"notes\": \"Performance report for the 2012 quail,
  ring-necked pheasant, and wild turkey statewide survey.  This survey provides Kansas
  Department of Wildlife, Parks, and Tourism with valuble reproductive data. Summer
  brood surveys were initiated in 1986 focusing on pheasant and quail. Turkey data
  was not collected and reported until 2006. These summer brood surveys are used to
  forecast upcoming hunting seasons and to provide consistent monitoring of these
  important game species.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
